function AboutPic() {
    return (
      <>
        <div className="w-full max-w-sm md:w-1/3 flex justify-center">
          <img
            src="/images/expanded-image.png"
            alt="Profile picture"
            className="w-[20rem] h-[20rem] rounded-3xl object-cover object-bottom"
          />
        </div>
      </>
    );
}

export default AboutPic;
